def preprocess_data(people):
    age_groups = {range(0, 6): '', range(6, 13): 'child', range(13, 20): 'adolescent', range(20, 31): 'young adult', range(31, 41): 'adult', range(41, 51): 'middle-aged adult'}
    locations = {'New York': 'East Coast', 'Los Angeles': 'West Coast', 'Chicago': 'Midwest', 'Houston': 'South', 'San Francisco': 'West Coast', 'Seattle': 'West Coast', 'Boston': 'East Coast', 'Atlanta': 'South', 'Dallas': 'South'}

    def get_age_group(age):
        for (age_range, age_group) in age_groups.items():
            if age in age_range:
                return age_group
        return 'senior'

    def get_location(city):
        return locations.get(city, 'Other')

    def get_friend_suggestions(person, people):
        suggestions = []
        person_age_group = get_age_group(person['age'])
        person_location = get_location(person['city'])
        for other_person in people:
            if other_person != person and other_person['gender'] == person['gender'] and (get_age_group(other_person['age']) == person_age_group) and (get_location(other_person['city']) != person_location) and any((hobby in other_person['hobbies'] for hobby in person['hobbies'])):
                suggestions.append(other_person['name'])
        return suggestions
    modified_people = []
    for person in people:
        modified_person = {'name': person['name'], 'age_group': get_age_group(person['age']), 'gender': person['gender'], 'location': get_location(person['city']), 'hobbies': person['hobbies'], 'friend_suggestions': get_friend_suggestions(person, people)}
        modified_people.append(modified_person)
    return modified_people

